import styles from "../styles/Skills.module.css";
import { Button } from "@mui/material";

const Skills = () => {
  return (
    <div className={styles.all}>
      <h1
        style={{
          margin: "0",
          paddingBottom: "2%",
          color: "#167c9e",
          fontSize: "30px",
        }}
      >
        Skills
      </h1>
      <Button
        style={{
          backgroundColor: "white",
          color: "#167c9e",
          borderRadius: "10%",
          borderWidth: "1px",
          borderColor: "#167c9e",
          borderStyle: "solid",
          fontSize: "15px",
          // padding: "2%",
          fontFamily: "Outfit",
          // width: "20%",
        }}
        className={styles.button}
      >
        Projects
      </Button>
    </div>
  );
};

export { Skills };
